// This function checks the operator WHERE query and returns the correct operator
function convertOperator(operator) {
  switch (operator) {
    case "=":
      return "$eq:";
    case "!=":
      return "$ne:";
    case ">":
      return "$gt:";
    case ">=":
      return "$gte:";
    case "<":
      return "$lt:";
    case "<=":
      return "$lte:";
    case "LIKE":
      return "$like:";
    case "IN":
      return "$in:";

  }
  return operator;
}
// This function checks the WHERE query and returns the correct expression operator
function checkAndOr(whereQuery) {
var where = request_parameters.where;
//remove white spaces from where 
where=where.split(' ').join('');
where=where.split("'").join('');
where= where.split(whereQuery)[1];

  if (where.toLowerCase().startsWith("and")) {
    return "$and:";
  } else if (where.toLowerCase().startsWith("or")) {
    return "$or:";
  }
  return "";
}

var expressionQuery = request_expression;
//var where = request_parameters.where;
var where="";
var path = request_vendor_path;
// if we don't have a WHERE query, then return / don't do anything
if (expressionQuery === null || expressionQuery === undefined) {
  done();
}

var filterString = "";
for (var i = 0; i < expressionQuery.length; i++) {
  var key = expressionQuery[i].attribute;
  var operator = convertOperator(expressionQuery[i].operator);
  var value = expressionQuery[i].value;
  var val=expressionQuery[i].value;
  // needs to look like (name$eq:'aShirt')$and:(status$eq:'Active')
   if (key == "accountNumber") {
    path = "/accounts/" + value + "/accounting-years";
	  if(filterString.endsWith('$and:') && i==expressionQuery.length-1){
	    filterString=  filterString.slice('$and:',-5);
	 }else if(filterString.endsWith('$or:') && i==expressionQuery.length-1){
	 	      filterString.slice('$or:',-4);
	 }
  }
  else{
  if (operator == '$in:') {
    var temp = value.split(",");
    for (var a in temp) {
      temp[a] = parseInt(temp[a], 10);
    }
    value = "[" + temp + "]";
    val="("+temp+")"
  }
  // if we have an AND / OR
  filterString +=  key + operator + value;

  if (expressionQuery.length > 1 && i != expressionQuery.length - 1) {
	where = key+expressionQuery[i].operator+val;
     filterString += checkAndOr(where) ;
  }
}
}
let map = {};
map.filter = filterString;

done({
  "request_vendor_parameters": map,
  "request_vendor_path": path
});

